  },
  {
    path: getImage("img9"),
    caption: "Fonte: Radilson Gomes, Ministério da Saúde.",
  },
  {
    path: getImage("img10"),
    caption: "Fonte: Radilson Gomes, Ministério da Saúde.",
  },
];

const getImage = () => require(`img/background-login.jpg`);

const background = require(`img/background-login.jpg`);
const imagePath = `${process.env.PUBLIC_URL}/img/background-login.jpg`;

export function LoginView() {
  return <div css={fragmentStyles}></div>;
}

const fragmentStyles = css`
  background-image: url(${background});
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  width: 100%;
  height: 100vh;
`;
